import React from 'react';
import {Link} from 'react-router-dom';



const NavBar = () => {

    return(
        <nav>
            <Link to ="Settings">Account</Link>
            <Link to ='Postings'>Product Postings</Link>
            <Link to ='Register'>Register/Login</Link>
        </nav>
    )
}

export default NavBar
